import './App.css';
import Navbar from './components/Navbar'; 
import Home from './components/Home';

const About = () => {
  return(
    <h2>About us</h2>
  )
}

function App() {
  return (
    <div >
      <Navbar />
      <Home />
      <About />
    </div>
  );
}

export default App;
